import React,{
  Component
} 
from 'react';

import Pomodoro from "./components/pomodoro";
import Timer from "./utilities/timer";

class App extends Component {
  timer = new Timer(10);
  render(){
    this.onStart(() => {
      console.log("start");
    })
    .onEnd(() => {
      console.log("end");
    })
    .onInterval(currentTime => {
      console.log(currentTime);
    });

    return (
      <Pomodoro
      onChangeBreakLength={e => console.log(e.target.value)}
      onChangeSessionLength={() => console.log(1)}

      onClickStart={() => timer.start()}
      onClickStop={() => timer.stop()}
      onClickReset={() => timer.reset()}
      onClickContinue={() => timer.continue()}

      display={"00:00:00"}/>
    );
  }
}

export default App;
